'From Squeak3.9 of 7 November 2006 [latest update: #7067] on 23 April 2007 at 2:11:19 pm'!"Change Set:		VmUpdates-1001-dtlDate:			23 April 2007Author:			David T. LewisRemove several unreferenced primitives. These have no apparent utility in the current VM. They contain type casts that are probably incorrect, that that produce compiler warnings on 64 bit host/32 bit image VM builds.This is the first of several change sets that address object memory addressing issues, particularly for host machines that may assign object memory addresses in the high order range of an unsigned 32 bit address space. The changes address oop comparison and type conversion within the object memory and interpreter.Prerequisites are:1) VMMaker 3.8b6 (from file VMMaker-tpr.58.mcz).2) Update to sqMemoryAccess.h with the following changes:85c85<   static inline char *pointerForOop(sqInt oop)                        { return sqMemoryBase + oop; }--->   static inline char *pointerForOop(usqInt oop)                       { return sqMemoryBase + oop; }109,110c109,110< # define pointerForOop(oop)           ((char *)(sqMemoryBase + (oop)))< # define oopForPointer(ptr)           ((sqInt)(ptr))---> # define pointerForOop(oop)           ((char *)(sqMemoryBase + ((usqInt)(oop))))> # define oopForPointer(ptr)           ((sqInt)(((char *)(ptr)) - (sqMemoryBase)))Other patches are required for various 64 bit host/image combinations, but are not directly relevent to this series of updates. See Mantis for details."!Interpreter removeSelector: #addressOf:startingAt:size:!Interpreter removeSelector: #primitiveByteArrayDoubleAt!Interpreter removeSelector: #primitiveByteArrayDoubleAtPut!Interpreter removeSelector: #primitiveByteArrayFloatAt!Interpreter removeSelector: #primitiveByteArrayFloatAtPut!Interpreter removeSelector: #primitiveByteArrayNByteIIntegerAtPut!Interpreter removeSelector: #primitiveByteArrayNByteIntegerAt!